import React from 'react';
import { View, Text } from 'react-native';
import TarefaDetalhes from '../components/TarefaDetalhes';

const TarefaDetalhesScreen = ({ route }) => {
  const { tarefa } = route.params;

  return (
    <View>
      <Text>Detalhes da Tarefa</Text>
      <TarefaDetalhes tarefa={tarefa} />
    </View>
  );
};

export default TarefaDetalhesScreen;
